import React from "react";
import PropTypes from "prop-types";

const Navbar = () => {
  return (
    <>
      <h1 className="change-color">Hello</h1>
    </>
  );
};
Navbar.propTypes = {
  name: PropTypes.string,
};

export default Navbar;
